import React from 'react';
import { useNavigate } from 'react-router-dom';
import useAuth from './useAuth';

const withAuth = (Component) => {
  const navigate = useNavigate();  
  return () => {
    const { token } = useAuth();

    if (!token) {
      navigate;
    }

    return <Component />;
  };
};

export default withAuth;
